import React, { ReactNodeArray, useContext } from "react";
import { CheckoutContext } from "./CheckoutContext";
import styles from "./CheckOutFlow.module.css"
import { CheckOutNavigation } from "./CheckOutNavigation";



interface Props {
     children: ReactNodeArray

}

export const AssistentFlow: React.FC<Props> = (Props) => {

    const onboardCtxt = useContext(CheckoutContext)
    const children = Props.children;



    const steps = ['Abo Auswahl', 'Art der Bezahlung', 'Zusammenfassung', 'Bestätigung'];

   return (
       <div className={styles["checkout-frame"]}>
            <div className={styles["checkout-content"]}>
               {children[onboardCtxt.step]}
            </div>
            <div className={styles["checkout-nav"]}>
                <CheckOutNavigation stepLabels={steps}/>
          </div>
       </div> 
    )
}
